    "2015-02-04T19:39:43.600120",nt"name": "performance-metrics-streets-sanitation-rodent-baiting-7e648",nt"isopen":
    false,nt"url": null,nt"notes": "In addition to performing regular scheduled
    preventative rodent control, the Department of Streets & Sanitation (DSS) responds
    to site-specific customer rat complaints logged through 311u2019s Customer Service
    Requests (CSR) system. This metric tracks the average number of days the DSS takes
    to complete rodent baiting requests per week. Median days to complete requests as
    well as total number of requests fulfilled per week are available by mousing over
    columns. The target response time for rodent baiting requests is within 7 days.
    For more information on open rat complaints, see https://data.cityofchicago.org/Government/311-Service-Requests-Rodent-Baiting-2011-/97t6-zrhs",nt"license_title":
